import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const RegistrationForm = ({ onBack }) => {
  const [formData, setFormData] = useState({
    idPersona: '',
    identificacion: '',
    nombre: '',
    correo: '',
    area: '',
    esAdmin: false,
    contraseña: '',
  });

  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleBack = () => {
    onBack();
  };

  const handleRegister = (e) => {
    e.preventDefault();
    // Aquí puedes realizar la lógica de registro, por ejemplo, enviar los datos al servidor
    console.log('Datos de registro:', formData);
    // Después de registrar, puedes redirigir o realizar otras acciones necesarias
  };

  return (
    <div>
      <h2>Registro</h2>
      <form onSubmit={handleRegister}>
        {/* Agrega los campos de registro con sus respectivas validaciones */}
        <div className="mb-3">
          <label htmlFor="idPersona" className="form-label">ID de Persona:</label>
          <input type="text" className="form-control" id="idPersona" name="idPersona" maxLength="10" required />
        </div>
        <div className="mb-3">
          <label htmlFor="identificacion" className="form-label">Identificación:</label>
          <input type="number" className="form-control" id="identificacion" name="identificacion" required />
        </div>
        <div className="mb-3">
          <label htmlFor="nombre" className="form-label">Nombre:</label>
          <input type="text" className="form-control" id="nombre" name="nombre" maxLength="50" required />
        </div>
        <div className="mb-3">
          <label htmlFor="correo" className="form-label">Correo:</label>
          <input type="email" className="form-control" id="correo" name="correo" maxLength="255" />
        </div>
        <div className="mb-3">
          <label htmlFor="area" className="form-label">Área:</label>
          <select className="form-select" id="area" name="area" onChange={handleInputChange} value={formData.area} required>
            {/* Opciones del combobox */}
            <option value="opcion1">Opción 1</option>
            <option value="opcion2">Opción 2</option>
            {/* ... Agrega más opciones según sea necesario */}
          </select>
        </div>
        <div className="mb-3 form-check">
          <input type="checkbox" className="form-check-input" id="esAdmin" name="esAdmin" onChange={handleInputChange} checked={formData.esAdmin} />
          <label className="form-check-label" htmlFor="esAdmin">¿Administrador?</label>
        </div>
        <div className="mb-3">
          <label htmlFor="contraseña" className="form-label">Contraseña:</label>
          <input type="password" className="form-control" id="contraseña" name="contraseña" maxLength="255" minLength="8" pattern="^(?=.*[a-z])(?=.*[A-Z])(?=.*\d).+$" required />
        </div>
        <button type="submit" className="btn btn-primary">Registrarse</button>
        <button type="button" className="btn btn-secondary" onClick={handleBack}>Volver</button>
      </form>
    </div>
  );
};

export default RegistrationForm;
